import React from 'react'
import User from './User';
import { useState } from 'react';

function UserList() {
  const [Userlist, setUserList] = useState([]);
  return (
    <div>
      <ul class="list-group">UserList.map((item)=>(<User data={item } />))</ul>
    </div>
  );
}

export default UserList
